  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0109918 includes discrete
  sample and profile data collected from METEOR in the North Atlantic Ocean and South
  Atlantic Ocean from 2009-10-26 to 2009-11-23. These data include AMMONIUM (NH4),
  CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED INORGANIC
  CARBON (DIC), DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, SALINITY,
  SULFUR HEXAFLUORIDE (SF6), TOTAL ALKALINITY (TA), Trifluoromethyl sulfur pentafluoride
  (SF5CF3), WATER TEMPERATURE, phosphate and silicate. The instruments used to collect
  these data include Alkalinity titrator, CTD, Coulometer for DIC measurement and
  bottle.nnThese data were collected by Arne Kortzinger, Toste Tanhua and Peter Brandt
  of Leibniz Institut Fur Meereswissenschaften as part of the CLIVAR_MT80_1_2009 data
  set. CDIAC associated the following cruise ID(s) with this data set: SFB 754 and
  SOPRANnnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\":
